import ButtonExamples from './components/ButtonExamples';
import AlertExamples from './components/AlertExamples';


const ComponentesEjemplo = () => (
	<div>
		<section>
			<ButtonExamples/>
		</section>
		<br/>
		<section></section>
		<AlertExamples/>
	</div>
);

export default ComponentesEjemplo;
